import React from 'react';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';
import { Link, useNavigate } from 'react-router-dom';
import COLORS from '../theme/colors';

function Navbar({ setIsAuthenticated }) {
  const navigate = useNavigate();
  const handleLogout = () => {
    setIsAuthenticated(false);
    navigate('/login');
  };
  return (
    <AppBar position="static" sx={{ bgcolor: COLORS.verdeOscuro, boxShadow: `0 2px 8px 0 ${COLORS.verdeBrillante}55` }}>
      <Toolbar>
        <Typography variant="h6" sx={{ flexGrow: 1, fontWeight: 'bold', letterSpacing: 2, color: COLORS.verdeBrillante }}>
          POLIXAI
        </Typography>
        <Button color="inherit" component={Link} to="/productos" sx={{ color: COLORS.blanco, '&:hover': { color: COLORS.verdeBrillante } }}>Productos</Button>
        <Button color="inherit" component={Link} to="/categorias" sx={{ color: COLORS.blanco, '&:hover': { color: COLORS.verdeBrillante } }}>Categor√≠as</Button>
        <Button color="inherit" component={Link} to="/clientes" sx={{ color: COLORS.blanco, '&:hover': { color: COLORS.verdeBrillante } }}>Clientes</Button>
        <Button color="inherit" onClick={handleLogout} sx={{ color: COLORS.acentoRojo, fontWeight: 'bold', ml: 2 }}>
          Salir
        </Button>
      </Toolbar>
    </AppBar>
  );
}

export default Navbar;
